import React from 'react';
import { useState } from 'react';
import './TopMenu.css';
import '../login.js';

const TopMenu = () => {
  const [sessionId, setSessionId] = useState(null);
  const login = () => {
    console.log('login')
  }
  return (      
    <div className="menu top">
      <div className="title">
        <span>COOK BOOK</span>
      </div>
    <div className="options">
      <div className="option" onclick={login()}>
        Sign In
      </div>
     </div>
    </div>
  )
}

export default TopMenu;
